import React from "react";
import 'bootstrap/dist/css/bootstrap.min.css';
import { Signimage} from "../pages/handimage";
import './css/card.css'

const Card=(props)=>{
    console.log(Signimage)
    return (
        <div className="card">
            <h1>{props.letter}</h1>
            <img src={Signimage[props.num]} alt={props.letter}></img>
        </div>
    );
}
export default Card;
